drop table player cascade constraints;
drop table player_hole_score cascade constraints;
drop table course cascade constraints;
drop table tournament cascade constraints;
drop table field cascade constraints;
drop table statistic cascade constraints;
drop table hole cascade constraints;

create table player
(
player_id NUMBER(6),
player_ln VARCHAR2(16),
player_fn VARCHAR2(16),
player_city VARCHAR2(32),
player_country VARCHAR2(32),
constraint player_player_id_pk PRIMARY KEY (player_id)
);

create table statistic
(
player_id NUMBER(6),
fedex_pt FLOAT(16),
earnings NUMBER(16),
scoring_avg FLOAT(12),
num_tournmaments NUMBER(2),
low_round NUMBER(2),
num_wins NUMBER(2),
num_second NUMBER(2),
num_third NUMBER(2),
num_top_5 NUMBER(2),
num_top_10 NUMBER(2),
num_cut_made NUMBER(2),
num_cut_miss NUMBER(2),
num_wd NUMBER(2),
num_dq NUMBER(2),
constraint statistic_player_id_pk PRIMARY KEY (player_id)
);

create table tournament
(
tournament_id VARCHAR(6),
name VARCHAR(64),
location VARCHAR(32),
start_date VARCHAR2(16),
end_date VARCHAR2(16), 
purse NUMBER(16),
fedex_pt NUMBER(6),
prev_winner VARCHAR(32),
constraint tournament_tournament_id_pk PRIMARY KEY (tournament_id)
);

create table course
(
course_id NUMBER(6),
tournament_id VARCHAR(6),
course_name VARCHAR(64),
par NUMBER(3),
length NUMBER(4),
constraint course_course_id_pk PRIMARY KEY (course_id),
constraint course_tournament_id_fk FOREIGN KEY (tournament_id) REFERENCES tournament(tournament_id)
);

create table hole
(
hole_num NUMBER(2),
course_id NUMBER(6),
hole_par NUMBER(1),
hole_length NUMBER(3),
hole_num_alba NUMBER(3),
hole_num_eagle NUMBER(3),
hole_num_birdie NUMBER(3),
hole_num_par NUMBER(3),
hole_num_bogey NUMBER(3),
hole_num_dbl_bogey NUMBER(3),
hole_num_dbl_or_worse NUMBER(3),
hole_avg_score FLOAT(10),
constraint hole_course_id_fk FOREIGN KEY (course_id) REFERENCES course(course_id),
constraint hole_hole_num_course_id_pk PRIMARY KEY(hole_num, course_id)
);


create table player_hole_score
(
player_id NUMBER(6),
course_id NUMBER(6),
hole_num NUMBER(2),
round_id NUMBER(1),
score NUMBER(2),
constraint phs_player_id_fk FOREIGN KEY (player_id) REFERENCES player(player_id),
constraint phs_stat_player_id_fk FOREIGN KEY (player_id) REFERENCES statistic(player_id),
constraint phs_course_id_fk FOREIGN KEY (course_id) REFERENCES course(course_id),
--constraint phs_hole_num_fk FOREIGN KEY (hole_num) REFERENCES hole(hole_num),
constraint phs_player_course_hole_pk PRIMARY KEY (player_id, course_id, hole_num, round_id)
);



create table field
(
player_id NUMBER(6),
tournament_id VARCHAR(6),
player_tournament_score VARCHAR2(3),
player_tournament_pos VARCHAR2(4),
player_tournament_earnings NUMBER(32),
player_tournament_fedex_pt FLOAT(16),
constraint field_player_id_fk FOREIGN KEY (player_id) REFERENCES player(player_id),
constraint field_tournament_id_fk FOREIGN KEY (tournament_id) REFERENCES tournament(tournament_id),
constraint field_player_tournament_id_pk PRIMARY KEY (player_id, tournament_id)
);









